import MyHeader from "./MyHeader";
import MyHead from "./MyHead";
import Footer from "./Footer";

const Layout = props => {
  return (
    <>
      <MyHead page={props.page} />
      <div id="Layout">
        <MyHeader />
        {props.children}
      </div>
      <Footer />
      <style jsx global>{``}</style>
    </>
  );
};

export default Layout;
